import {Link} from "react-router-dom";


const CreatePage = () => {
    return <div>
        <h1>Monte sua viagem!</h1>
        <Link to="/adminhome">Voltar</Link>
        <button>Montar!</button>
    </div>



}

export default CreatePage;
